class Solution:
    def repeatedStringMatch(self, a: str, b: str) -> int:
        count = 0
        len_b = len(b)
        x = 0
        while x < len_b:
            count += 1
            c = a * count
            if len(c) <= 10**4:
                if b in c:
                    return count
            else:
                return -1
            x += 1
        return -1




